import banner from '../images/banner.jpg'

const Banner = () => {
  return (
    <>
      <img 
        id='banner'
        src='https://images.unsplash.com/photo-1477332552946-cfb384aeaf1c?q=80&w=1170&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D'
        alt='banner image of nature'
      />
    </>
  )
}

export default Banner
